webpackJsonp([95420692194759],{1377:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Psyked.co.uk",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/rituals-dogma-and-the-agile-manifesto-99df0b7d6525/index.md absPath of file >>> MarkdownRemark",html:'<h1>Rituals, dogma and the Agile Manifesto.</h1>\n<p>I can’t quite work out if Agile is a buzzword, a cult or some larger form of organised religion. I’m lost in a sea of ritualistic meetings and awash with stuff like #shipit and “Get Shit Done”.</p>\n<p>Build, Measure, Learn. Done is better than Perfect. Stop, Start, Continue. Be Lean. Deliver, Iterate, Repeat. Liked, Lacked, Loved, Longed for. Sad, Mad, Glad, Puzzled. Retro, Backlog, Burndown, Velocity. <em>Landing the Plane.</em></p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/portfolio-2018/static/1*bVOjeGtk6RJhFzhywjUDUg-21a485aed818d6dbd37176bd029fbf04-b54a2.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 630px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 50%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="1 bVOjeGtk6RJhFzhywjUDUg"\n        title=""\n        src="/portfolio-2018/static/1*bVOjeGtk6RJhFzhywjUDUg-21a485aed818d6dbd37176bd029fbf04-082ce.png"\n        srcset="/portfolio-2018/static/1*bVOjeGtk6RJhFzhywjUDUg-21a485aed818d6dbd37176bd029fbf04-c7cb1.png 158w,\n/portfolio-2018/static/1*bVOjeGtk6RJhFzhywjUDUg-21a485aed818d6dbd37176bd029fbf04-93041.png 315w,\n/portfolio-2018/static/1*bVOjeGtk6RJhFzhywjUDUg-21a485aed818d6dbd37176bd029fbf04-082ce.png 630w,\n/portfolio-2018/static/1*bVOjeGtk6RJhFzhywjUDUg-21a485aed818d6dbd37176bd029fbf04-c4006.png 945w,\n/portfolio-2018/static/1*bVOjeGtk6RJhFzhywjUDUg-21a485aed818d6dbd37176bd029fbf04-b54a2.png 1000w"\n        sizes="(max-width: 630px) 100vw, 630px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Are we even doing the right thing? Do we know what we’re doing and – more importantly – why we’re doing it? I’m so confused.</p>\n<hr>\n<p>Reposted from <a href="https://www.psyked.co.uk/rituals-dogma-and-the-agile-manifesto/">https://www.psyked.co.uk/rituals-dogma-and-the-agile-manifesto/</a></p>',frontmatter:{title:"Rituals, dogma and the Agile Manifesto.",date:"January 04, 2017",tags:null}}},pathContext:{}}}});
